import React from 'react'

import './LinerProsentage.scss'

function LineerProsentage({prosentage = 80}) {
    if(prosentage)
    return (
        <div className="d-flex">
            <div className="oval-fill mx-1" />
            <div className="oval mx-1" />
        </div>
    )
}

export default LineerProsentage
